Who We Are:
More than 30 years ago, E*TRADE pioneered the online brokerage industry by executing the first-ever electronic individual investor trade. While the landscape of our industry has changed dramatically, our culture of innovation and drive to make online trading accessible to everyone continues to drive us forward. We believe in challenging the status quo, fostering an environment of curiosity and learning, and, above all, putting our customers first.

About the Role:
SUMMARY

The Analyst, Data Analytics is responsible for working with the E*TRADE risk teams to identify, support and enhance risk management using the power of data to provide greater assurance and coverage while improving process efficiency and effectiveness, aiding management in their pursuit of strategic, operational, compliance, and financial reporting objectives.

RESPONSIBILITIES

Support the Enterprise, Operational, and IT risk management teams’ objectives by assisting with efforts to build out and maintain continuous risk assessment capabilities;
Assist control testing services team with build out of automated control testing programs and risk-based sampling approaches;
Understand, identify, and utilize emerging data analytic technologies such as predictive analytics, machine learning, and robotics to aid in risk assessment and assurance;
Transform existing manual processes using automation and other methods to allow for efficiency and repeatability and
Produce and maintain rigorous documentation for repeatability and implement controls to ensure continued reliability and compliance with applicable E*TRADE policies and procedures; and
Collaborate with the business and IT teams to understand the individuals, applications, and data sets used to support business processes.

Qualifications:
REQUIREMENTS

Four-year college degree in Mathematics, Statistics, Computer Science, Information Systems, Accounting, Finance or related major; Masters in related discipline is a plus.
Up to 2 years of working experience in performing data analytics; experience in working within a Risk department and within a financial institution is a plus;
1-2 years of working experience with Tableau or similar business intelligence tools;
Intermediate proficiency in scripting with SQL, SAS, R, and/or Python;
Ability to collect, analyze, and evaluate technology specific information and prepare detailed documentation and reporting of work performed;
Experience with relational databases and SQL;
Experience with working in an AWS environment a plus; and
Ability to collect, analyze, and evaluate technology specific information and prepare detailed documentation and reporting of work performed.

SUCCESS FACTORS

Proficiency with data analytics and analysis, including handling large data volumes;
Ability to glean insightful trends/stories from data analysis;
Risk mindset and ability to discern key risks;
Analytical ability, attention to detail and accuracy, and creative thinking;
Curiosity, perseverance and ability to dig into details;
Good verbal and written communication skills, including presentation skills;
Meticulousness, diligence and high level of integrity and work ethic;
Effective time management skills; and
Ability to work well in a team setting.

The applicant must be a U.S. citizen to qualify for the required U.S. government security clearance for this project.

DevTech Systems, Inc. (DevTech) is an international consulting firm dedicated to development, with 35 years of experience providing advisory services and technical assistance to government, private sector, and civil society stakeholders in more than 100 countries. DevTech core practice areas include: Economic and Data Analysis, Monitoring and Evaluation, Education and Youth Development, Gender and Inclusive Development, and Public Financial Management. The Data Analyst will work on the new USAID Analytics, Data, Visualization, and Information Services (ADVISE) project. ADVISE is a follow-on to the USAID Economic Analysis and Data Services (EADS) project. ADVISE's main purpose is to improve the usage of USAID data and information, so that the Agency continues to ensure its development outcomes are supported by evidence.

Overview:
The Data Analyst works on ADVISE databases using statistical software (including SAS, R, and Python), writes analyses using international development data, and responds to requests for data, analysis, and online products. The Data Analyst provides analytical products and services using socioeconomic data and information resources, which will include running queries on databases, enterprise systems, and other primary data sources. The Data Analyst supports special projects which span any of the systems, websites, and services under ADVISE and may include reports, visual products, and maps or other geospatial products based on underlying data. The Data Analyst supports, with official reporting requirements, fielding analytics requests from customers, and processing and analyzing economic and other data in a variety of formats from multiple sources. The Data Analyst reports to the task lead.

Primary Duties and Responsibilities:
Support the collection and harmonization of data from socio-economic sources, USAID enterprise systems, and foreign assistance data from a wide and disparate range of information sources, in a variety of formats;
Administer data calls and surveys, and will have a strong background in applying quantitative methods to produce new insight and analytical products;
Support processes related to collecting, verifying, redacting, normalizing, and otherwise processing data received from multiple sources;
Support the development quantitative models, methodologies, and business processes and must be conversant in using statistical packages such as SAS, R, Python, Stata, and related programs;
Examine statistics and indicators to draw conclusions and present results in visually intuitive formats;
Develop data analysis, including statistical analysis and compelling data visualizations, and development of analytical reports tailored to USAID needs;
Develop online applications for data analysis for use by USAID staff and the public;
Communicate analysis to a variety of USAID staff;
Provide USAID staff with data analysis training.

Qualifications:
Education: Master's Degree in Economics, international development, or related field.
Experience: At least two years of related experience in analytics, economics, development economics, data or computer science, or relevant subject.
Knowledge: Knowledge of and interest in the economic and international development and relations fields.
Skills: Experience using data to support research efforts, strong levels of data literacy, and solid grounding in the principles of data validity and integrity. Sectoral knowledge in one or more of several economic fields relevant to USAID work, such as economic growth, poverty, trade, international development finance and aid effectiveness. Knowledge of statistical software such as SAS, Python, Stata and R preferred. Must have interest in database management and strong understanding of relational database principles.
Highly motivated and responsible self-starter. Excellent interpersonal, communication and writing skills, including with technical audiences. Strong leadership and solid teamwork.

The applicant must be a U.S. citizen to qualify for the required U.S. government security clearance for this project.

All qualified applicants will receive consideration for employment and will not be discriminated against on the basis of race, color, religion, sex, national origin, disability, sexual orientation, protected veteran status or other status protected by applicable law.

NOTE: This position description should not be construed to imply that the requirements are the exclusive standards of the position nor will it be the sole basis for any subsequent employee evaluations. Incumbents will follow any other instructions and perform any other related duties as may be required by their supervisor.

William James College Institutional Research is seeking a Research Data Analyst (RDA) to assist in the gathering, analysis, and reporting of institutional data. This position will report to the Director for Research. The Research Data Analyst will perform routine research and data management activities and procedures. The RDA will provide research/administrative assistance to the following subunits:

Institutional Research
Student Outcome Measurement/Assessment
Faculty Development
Institutional/Program Effectiveness
Data Governance/Management

Essential Functions and Responsibilities:
Assist in the development of standard data collection instruments (e.g., online surveys) and research methodologies (e.g., quantitative, qualitative, and/or mix-methods);
Perform a variety of routine data collection procedures (implement online surveys, assist in recruitment, obtaining informed consent, administering protocols, conducting interviews, making direct observations, abstracting secondary data from existing records, taking notes, etc.);
Perform a variety of routine data management procedures (e.g., coding raw data, data entry, importing/exporting data across platforms, producing basic reports, data cleaning, database maintenance);
Perform quantitative data analysis (basic descriptive statistics and bivariate analyses; multivariate experience, etc.);
Perform data visualization to effectively communicate results to various audiences;
Perform qualitative data analysis to organize and analyze data for thematic content;
Ensure data integrity and accuracy. Reconcile data discrepancies between different data sources;
Maintain established institutional and departmental policies and procedures, objectives, quality assurance programs and safety standards;
Consistently apply the institution’s values of respect, honesty and fairness and the pursuit of excellence in improving the social and behavioral health status of people, institutions and communities;
Maintain collaborative team relationships with peers and colleagues in order to effectively contribute to the working group’s achievement of goals, and to help foster a positive work environment;
Enhance professional growth and development through participation in educational programs, reading current literature, in-service meetings, and workshops as needed
Performs other similar and related duties as required or directed.

Required Qualifications:
Bachelor’s degree and 5 years’ of research-related experience OR Master’s degree and 2 - 3 years’ of research-related experience
Experience working in an academic environment and/or institutional research setting desirable
Knowledge of research methods, principles, ethics;
Knowledge of outcome assessment and program evaluation Ability to perform basic data management tasks (data coding, entry, cleaning, maintenance);
Ability to perform basic data analysis, visualization, and reporting (quantitatively, qualitatively and graphics);
Experience using quantitative data analysis software helpful (e.g., SPSS, Excel); experience with qualitative software also helpful (e.g., MAXQDA, NVivo);
Experience using online survey platforms helpful (e.g., Qualtrics);
Experience using data visualization software helpful (e.g., Excel, Power BI, Tableau);
Advanced knowledge of a programming language is a plus (e.g., R or Python)
Strong interpersonal skills, diplomacy in interactions, and ability to maintain confidentiality.
Ability to work independently with minimal supervision and as part of cross-functional teams.
Collaborative working style with excellent analytical, written and verbal communication skills.
Excellent consultative, project management, and problem-solving skills.

Interested candidates should submit a cover letter and resume to Michelle Costa, Human Resources Coordinator, at HR@williamjames.edu.

William James College is an institution and a community committed to the principles of excellence, fairness and respect for all people. Our Inclusive Excellence model infuses diversity, equity and inclusion efforts into the core of institutional functioning to realize the educational benefits of diversity both locally and globally. We are committed to strengthening communities, including our workplace, by fostering the development of the intercultural competencies necessary for change agents in an increasingly complex, pluralistic society.

The Mid-America Regional Council, the Kansas City area’s nonprofit association of city and county governments and metropolitan planning organization, is seeking a qualified professional to serve in the Research Services department as a Research/Data Analyst.

Governed by a board of 33 local elected officials, MARC provides a forum for the region to work together to advance the social, economic, and environmental progress of the Kansas City region. MARC promotes regional cooperation through leadership, planning and action. Our work is organized around eight key policy goals: efficient transportation and quality places; a healthy environment; a competitive economy; effective local government; safe and secure communities; thriving older adults and communities; quality early learning; and exemplary core capacities. We are committed to core values of integrity, innovation, collaboration, diversity and inclusion, excellence in performance, and service leadership. For additional information visit www.marc.org.
Job Summary
This full-time position’s primary responsibility is to turn data into insights that improve public, private and community decisions affecting the quality of life in the Kansas City region. A passion for our city and using data to improve it, combined with demonstrated analytical versatility and expertise, is key. The candidate will work on diverse issues using a wide variety of technical tools and data to understand underlying causes, trends and relationships important to decision-making, and clearly communicate the insights derived to audiences with a range of technical sophistication orally, digitally and in writing.
Job Responsibilities
As a Research/Data Analyst reporting to the Director of Research Services, you would:
Collaborate with MARC’s program staff and external stakeholders to identify the data and analysis needed for them to help the community make progress on issues related to economic growth and development, transportation investments, environmental quality, health, demographic changes, equity and inclusion, educational attainment, workforce development, housing, community development and public safety;
Work closely with the department’s data team to design and implement processes to automate the data flow needed to support the analysis;
Partner with the Director of Research Services and the Senior Researcher to brainstorm analytical approaches, determine project timelines and conduct analyses;
Conduct analyses using mathematical and statistical models of metropolitan economies;
Display result using a variety of data visualization techniques including maps, charts and graphs, both static and interactive.
Provide multiple opportunities for feedback from the program staff and stakeholders at key stages of the analysis;
Prepare oral, digital and written communications in collaboration with MARC’s Public Affairs department;
Present the insights derived to a wide variety of stakeholder groups including elected officials, local government staff, business leaders and community groups
Mentor other technical staff within MARC on the use of advanced analytical techniques in order to raise their capacity to conduct similar analyses.
While schedules will be set so that the work can be completed within a 40-hour work week, in the event of unanticipated work or issues, you will occasionally be expected to work beyond 40 hours to meet established deadlines.
Job Requirements
The successful candidate will demonstrate energy and expertise using data to deepen understanding of complex community issues and turn that data into understandable stories. They will show a passion for learning, solving problems and public service, as well as an ability to work well with others in a spirit of collaboration.

Minimum qualifications include:
A bachelor’s degree in economics, planning, transportation planning, environmental science, geography, sociology, biology or related field
Demonstrated quantitative proficiency using at least one of the following technical tools: statistics, predictive modelling, geospatial analysis, GIS, relational databases, informatics or data science;
Repeated experience in automating or streamlining data and analytical processes;
Demonstrated proficiency in managing multiple projects effectively and efficiently so they stay on schedule; and
Excellent oral and written communication skills,

Preferred qualifications include:
Quantitative expertise in at least three of the above technical tools, with an emphasis on predictive modelling, relational databases and GIS;
A master’s degree in one of the above fields;
Three years of increasingly responsible experience;
Proficiency using public data sources such as the Census Bureau, the Bureau of Labor Statistics and the Centers for Disease Control;
Experience analyzing administrative records data that might be confidential due to personally identifiable information;
Proficiency using SQL Server, Python, R, SAS, Tableau or similar software tools to automate analyses and visualize results;
Demonstrated ability to publish results on-line; and
Experience using machine learning and Big Data, especially data from location-based services.
Additional Information
This is a full-time exempt position. The starting salary range is $60,000 to $80,000, depending on qualifications and experience. This position is open until filled. Applicants should submit a writing sample where technical issues and results are clearly and succinctly described using text and graphics.
